import React, { Component } from 'react'; 

class Button extends Component {
  render(){
    return (
      <div>
        <label class="label" for="name">Enter Name:</label>
        <input id="name" type="text" />
        <button>Submit</button>
      </div>
    )
  };
}

export default Button;
